INSERT INTO `app_section` (`id`, `app_id`, `sort`, `classname`, `colour`, `content`)
VALUES
	(1,1,0,'cs-section-intro','#ff6666','## Scenario\r\nYou\'ve been given a 75-page Word document (no doubt full of tables, images and annotations) and been told to make it into a SCORM-compliant package for your LMS, and learners needs to view at least to page 60 before they are considered complete. And your boss has asked for it to be done yesterday.\r\n\r\nSure. How about in the next 5 minutes? No worries.\r\n\r\n## We convert your documents, media and slides right in your browser.\r\n![HTML5 Logo](/img/HTML5_Logo_128.png){.float-left}\r\nOur Document Scormification Ninja is a special in-browser course wizard. With it you can take your existing content converting it to modern, industry standard HTML5 and give it a SCORM wrapper, making it ready to upload into your LMS platform, all in a matter of minutes, and all by dragging links or files onto your browser.\r\n\r\n## Your content is what\'s important.\r\nHere\'s the thing: your content is what\'s important, and you probably don\'t have that much time already. So just drag and drop your files or URL\'s onto our app, give your course a name, and press download. It\'s that easy. Most of the time the converted HTML5 documents are pixel-perfect to the original document. You\'ll be surprised how good it is. You can also split multi-page documents into separate navigation items (it\'s really handy, be sure to try it).\r\n\r\n<p class=\"formats\">If a document *can* convert to HTML5, we probably support it - <span class=\'uk-label\'>abw</span> <span class=\'uk-label\'>doc</span> <span class=\'uk-label\'>docx</span> <span class=\'uk-label\'>epub</span> <span class=\'uk-label\'>gif</span> <span class=\'uk-label\'>html</span> <span class=\'uk-label\'>imgur gallery</span> <span class=\'uk-label\'>jpeg</span> <span class=\'uk-label\'>key</span> <span class=\'uk-label\'>lit</span> <span class=\'uk-label\'>md</span> <span class=\'uk-label\'>mobi</span> <span class=\'uk-label\'>moodle book (ims cp)</span> <span class=\'uk-label\'>odp</span> <span class=\'uk-label\'>odt</span> <span class=\'uk-label\'>pages</span> <span class=\'uk-label\'>pdf</span> <span class=\'uk-label\'>png</span> <span class=\'uk-label\'>ppt</span> <span class=\'uk-label\'>pptx</span> <span class=\'uk-label\'>ps</span> <span class=\'uk-label\'>slideshare</span> <span class=\'uk-label\'>soundcloud</span> <span class=\'uk-label\'>tiff</span> <span class=\'uk-label\'>txt</span> <span class=\'uk-label\'>vimeo</span> <span class=\'uk-label\'>webp</span> <span class=\'uk-label\'>youtube</span> + many other formats.</p>\r\n\r\n'),
	(2,1,2,'cs-section-graph','#ffffff','<div class=\"uk-grid-large uk-child-width-expand@s uk-text-center\" uk-grid>\r\n  <div>\r\n     <h3>Your current system</h3>\r\n     <p>You time is mostly spent EDITING. There\'s more steps.</p>\r\n     <div id=\"theirchart\"></div>\r\n  </div>\r\n  <div>\r\n     <h3>Document Ninja</h3>\r\n     <p>Your time is mostly spent DELIVERING, less time BUILDING.</p>\r\n     <div id=\"ourchart\"></div>\r\n  </div>\r\n</div>\r\n\r\n<script type=\"text/javascript\" src=\"https://www.gstatic.com/charts/loader.js\"></script>\r\n<script type=\"text/javascript\">\r\ngoogle.charts.load(\"current\", {packages:[\"corechart\"]});\r\ngoogle.charts.setOnLoadCallback(theirProcess);\r\ngoogle.charts.setOnLoadCallback(ourProcess);\r\nfunction theirProcess() {\r\n  var data = google.visualization.arrayToDataTable([\r\n    [\'Task\', \'Relative time taken\'],\r\n    [\'Cutting & Pasting\',     65],\r\n    [\'Editing templates\',      35],\r\n    [\'Tweaking each page\',  18],\r\n    [\'Frsutration ...\', 7],\r\n    [\'(re)Publishing\',    10],\r\n    [\'Fixing Browser Bugs\', 15]\r\n  ]);\r\n  var options = {\r\n    is3D: true,\r\n  };\r\n\r\n  var chart = new google.visualization.PieChart(document.getElementById(\'theirchart\'));\r\n  chart.draw(data, options);\r\n}\r\nfunction ourProcess() {\r\n  var data = google.visualization.arrayToDataTable([\r\n    [\'Task\', \'Relative time taken\'],\r\n    [\'Importing content\',     3],\r\n    [\'Styling\',      1],\r\n    [\'Loading to LMS\',  2],\r\n    [\'Delivery to your learners\', 80],\r\n  ]);\r\n  var options = {\r\n    is3D: true,\r\n  };\r\n\r\n  var chart = new google.visualization.PieChart(document.getElementById(\'ourchart\'));\r\n  chart.draw(data, options);\r\n}\r\n</script>'),
	(3,1,3,'cs-section-more','#ccff66','<div class=\'uk-column-1-2@m\' markdown=\'1\'>\r\n## Straightforward commonplace settings with sensible defaults\r\nYou can convert and embed multiple files from different sources, including files of different formats (combine full-page images with YouTube videos and PDF documents, for example). We offer a few easily navigable layouts optimised for most e-learning environments (just the basics). We haven\'t gone all out allowing you to customise every detail in the design: the aim of this tool is for you to get your content online in minutes. You can even drag the package you generate back on and continue working on it later.\r\n\r\n## Embeddable content\r\nLearning material is often best presented using slideshows, video and audio. But video and audio are large files, with complex caveats depending on the learners platform - you often don\'t know if they use an old laptop or a brand-new iPad, and what works on one might not work on the other. So **we don\'t let you embed video or audio**. When it comes to video and audio, upload them to YouTube, Vimeo or SoundCloud, since those platforms do all the hard work of supporting thousands of end-user devices (and have great privacy options).\r\nBut we do support images, imgur galleries and files, and even SlideShare. Need a scorm completion after a person views half the slides in a SlideShare? Sure thing.\r\n\r\n## How it works\r\nYour documents, images and slideshows will be converted using a cloud-based web service to HTML5. This service supports most formats such as Microsoft Office (Word, PowerPoint, Excel, Works), OpenOffice, AbiWord, Pages, KeyNote, StarWriter, Lotus Word Pro, as well as PDF, Markdown, and even many DRM-free e-book formats (mobi, epub, azw, lit, etc). In fact, if you find a format that *doesn\'t* convert then please let us know!\r\n\r\n* Your documents (e.g. PDF)\r\n* Drag onto Document Ninja\r\n* Conversion (cloud-based service)\r\n* Play with Layout & Settings\r\n* Download (zip file)\r\n* Upload to your LMS\r\n* Happy learners!\r\n\r\n## Completion, Progression, and other options\r\nSCORM is the existing standard that lets reusable, platform-agnostic content communicate data to the host LMS. In most cases this boils down to a single question: *Has the user completed the content?* And in most courses, this is really what you care about.\r\nIn many content authoring packages on the market today, SCORM and completion settings seem unnecessarily complicated, but they don\'t have to be. In our tool we have made some fundamental assumptions based on years of experience in what customers require. In short:\r\n\r\n* The score of the course represents how much is completed (as a percentage).\r\n* Learners may leave and return more than once before they complete. We remember where they are up to, even for most embedded content.\r\n* Completion occurs either when the user views the last page, or gets to a certain point in the course (such as has completed 7 out of 10 pages).\r\n* Tracking individual pages and satisfying objectives at a page level generally doesn\'t happen (it\'s usually done at a unit, course or activity level).\r\n\r\nWe also assume there\'s only two ways to progress through a course. Either page-by-page in order (like a book) or any order (you can skip pages if you choose). So there\'s only two settings.\r\nOh, and did we mention you can get a completion for **watching a some or all of a video**, or **viewing some of a SlideShare presentation**? You can still track how much of the media the user has watched or heard and score the page based on that information. You can use your LMS\'s SCORM tracking tool to examine how much of a video a user has watched, plus if they get more than (say) 75%, they get a completion too. How cool is that? (p.s. if that\'s all you\'re looking for try out our Media Ninja product).\r\n\r\n## Who owns the content?\r\nWe don\'t want your content. And so we don\'t store it. In fact, it\'s never even uploaded to our servers (it\'s temporarily sent to the cloud for document conversion, but is deleted immediately afterwards). So your content is safe with **you**.\r\nYour content is stored by your own browser, which is permanent until you reset the app. So after you are finished, remember to reset (especially if you are using a shared computer).\r\nWe do keep your email address on file, and we track some details about how you *use* our software (which settings are most popular), but that\'s all we know about you or your data.\r\n\r\n## What about editing?\r\nYou can change the order of pages, split long documents into multiple pages, remove or rename individual pages, and change the design or colour theme of the navigation wrapper.\r\nThis isn\'t an editing platform. Do your edits in your source: Word or Powerpoint or SlideShare or whatever (that is; use the tools are best at the job) and just convert their output. But you can *tweak* text after the file is converted (with caution, useful for a typo or two, but not a paragraph). We have other tools with full editing capability.\r\n\r\n</div>\r\n'),
	(4,1,4,'cs-section-browser uk-background-muted','#66ff66','## Browser requirements\r\nWe have developed the **builder app** to be most compatible with Google Chrome or Mozilla Firefox for *desktops*. It might work in other browsers, or might not. The **builder** currently doesn\'t work on mobile devices (but we are considering it) because of limitations with their file systems.\r\nThe **content you produce** should work fine *in any modern browser*, depending on the capabilities and what you put in yourself, and the host LMS (Don\'t expect a 15MB image to show on a mobile device, or a Vimeo video to play offline).\r\n'),
	(5,2,2,'cs-section-faq cs-background-starburst','#ffffff','## Frequently asked stuff\r\n<details>\r\n      <summary>Why would I want to track videos with SCORM?</summary>\r\n      <p>Let\'s say your learners need to watch material in order to gain a Continuing Professional Development (CPD) credit. Their industries\' rules state that they need to watch at least 45 minutes of a 1 hour video in order to gain 1 point. </p>\r\n      <p>The tool lets you do that. You can specify a video URL, set the completion requirement to 75%, and publish it as a SCORM package. You then just drop this into your LMS and start recording the completions.</p>\r\n      <p>We also record how much of the video has been watched. This has two benefits - <em>for the learner</em> it means they can exit the activity and come back another time and have the video pick back up where they left off; and <em>for the trainer</em> it means you can report on exactly how much of the media an individual is actually watching or listening to.</p>\r\n</details>\r\n<details>\r\n      <summary>What SCORM version do you publish to?</summary>\r\n      <p>We package using SCORM 1.2, as it is the most widely implemented version.</p>\r\n</details>\r\n<details>\r\n      <summary>What are the video sizes?</summary>\r\n      <p>It\'s generally recommended to use the Responsive size, as this means the video will scale to fit its container whilst maintaining a 16:9 aspect ratio.</p>\r\n      <p>Media sizes are taken from the default options for each of the players\' embed options. These are:</p>\r\n      <ul>\r\n            <li><b>YouTube</b> - Small: 560px x 315px, Large: 853px x 480px, Responsive: 100% x 56.25%</li>\r\n            <li><b>Vimeo</b> - Small: 500px x 281px, Large: 960px x 540px, Responsive: 100% x 56.25%</li>\r\n            <li><b>SoundCloud</b> - Small: 100% x 166px (Standard layout), Large: 100% x 450px (Visual layout), Responsive: 100% x 56.25% (Visual layout)</li>\r\n            <li><b>BrightCove</b> - Small: 512px x 288px, Large: 768px x 432px, Responsive: 100% x 56.25% (16:9)</li>\r\n      </ul>\r\n</details>\r\n<details>\r\n      <summary>Which Learning Management Systems do you support?</summary>\r\n      <p>Any SCORM 1.2 compliant LMS, such as Moodle, Janison CLS,Course Cloud, Totara, Scorm Cloud, Blackboard, or hundreds of others.</p>\r\n</details>\r\n<details>\r\n      <summary>What if a learner only watches some of the video and returns later to watch the rest?</summary>\r\n      <p>They will resume the video or sound file at the exact moment they left the package when they return -and their completion will occur when they reach the desired percentage of media to be viewed.</p>\r\n</details>\r\n<details>\r\n      <summary>What about privacy? I don’t want the whole world being able to access our videos.</summary>\r\n      <p>You need to consult the options for your video host. For instance, some Vimeo accounts can restrict which domains are able to watch the video.</p>\r\n</details>\r\n<details>\r\n      <summary>Do I need to download any software to use this app?</summary>\r\n      <p>Since it is web based, it requires no installation or any plugins</p>\r\n</details>\r\n<details>\r\n      <summary>How do I embed BrightCove video?</summary>\r\n      <p>Ok, this one is a little involved. BrightCove has a concept called Players, which are skins for the various videos. Each video can be published with one or more skins, and you can set up multiple players. One of these is a HTML5 player, and in it you must also specify that the player use API\'s and HTML5 delivery. Please refer to the BrightCove documentation about how to do this.</p>\r\n      <p class=\"text-center\"><img src=\"/img/brightcove_player.png\"></p>\r\n      <p>Some brightcove player embed codes look like this: <em>http://bcove.me/u4bjl68t</em> - we can\'t support this format since it doesn\'t identify which player will be used (it *might* be one with an API enabled, but there isn\'t a way to know). So you have to use the <b>javascript</b> embed code, which you can find in the Quick Video Publish tool:</p>\r\n      <p class=\"text-center\"><img src=\"/img/brightcove_publish.png\"></p>\r\n</details>\r\n\r\n<details>\r\n      <summary>Why the Ninja?</summary>\r\n      <p>Because it’s cool. We like ninjas.</p>\r\n</details>'),
	(6,2,6,'cs-section-engine','#ffffff','## Under the hood\r\nSo you might be wondering what the innards of this thing actually are (how it works). It uses a minimal SCORM 1.2 based engine that, like most wrappers, expects the SCORM API to exist in a parent frame or window. It also has hand-coded listeners that tap the player API\'s that BrightCove, YouTube, Vimeo and SoundCloud expose on order to capture information about the media being played. These wrappers call SCORM commands as the media plays.\r\n\r\n<details>\r\n    <summary>Click here for all the gory details</summary></p>\r\n    <ol>\r\n        <li><b>onload</b>:<ol>\r\n            <li>perform a scorm initialise (gets the api)</li>\r\n            <li>read <em>cmi.core.entry</em> (set to ab-initio on first launch)</li>\r\n            <li>read <em>cmi.core.lesson_location</em> (last position in video)</li>\r\n        </ol></li>\r\n        <li><b>on video start</b>:<ol>\r\n            <li>set <em>cmi.core.exit</em> to \"suspend\"</li>\r\n            <li>set <em>cmi.core.lesson_status</em> to \"incomplete\"</li>\r\n            <li>perform a scorm commit</li>\r\n        </ol></li>\r\n        <li><b>periodically</b> (as video is playing):<ol>\r\n            <li>set <em>cmi.core.lesson_location</em> to the number of seconds the video is up to. You can use this value to check how much a learner actually viewed through to.</li>\r\n            <li>Check the required amount to be watched, and if it matches or is greater, perform a completion (see below).</li>\r\n        </ol></li>\r\n        <li><b>on pause, rebuffer, or end</b>:<ol>\r\n            <li>Call LMS Commit to persist the changed data (e.g. seconds played)</li>\r\n        </ol></li>\r\n        <li><b>on completion</b>:<ol>\r\n            <li>set <em>cmi.core.exit</em> to \"\" (blank string, effectively means \"logout\" according to the SCORM spec)</li>\r\n            <li>set <em>cmi.core.lesson_status</em> to \"completed\"</li>\r\n            <li>set <em>cmi.core.score.min</em> to \"0\"</li>\r\n            <li>set <em>cmi.core.score.max</em> to \"100\"</li>\r\n            <li>set <em>cmi.core.score.raw</em> to the required percentage</li>\r\n            <li>perform a scorm commit</li>\r\n        </ol></li>\r\n        <li><b>onunload</b>:<ol>\r\n            <li>perform a scorm commit</li>\r\n            <li>perform a scorm finish</li>\r\n        </ol></li>\r\n    </ol>\r\n    <p>Effectively, this means the video is able to be resumed from the point the learner leaves, as <em>lesson_location</em> is being stored. It also means that the score required for completion in your LMS is the same percentage that needs to be watched.</p>\r\n</details>'),
	(7,2,0,'cs-section-intro','#ffffff','## Add completions to videos.\r\n\r\nMedia Ninja lets you watch a video (or listen to an audio file) then get a completion after you reach a certain amount\r\n\r\n## How does it work?\r\n\r\nThis tool will wrap content that is hosted by streaming providers such as YouTube and Vimeo in a special player that knows how far through a user has watched. You can optionally hide the \"scrubber\" bar (the draggable item that lets users skip ahead or back in a video) so your learners can\'t skip ahead. You then simply set a condition regarding when to mark the media as completed - typically by setting a time/percentage watched. After that marker is reached, we send a SCORM completion to your LMS.\r\n\r\n## Why only support streaming media?\r\n\r\nBrightCove, YouTube, Vimeo and SoundCloud all work very hard to support the widest range of browsers and platforms for their content - its in their best interest. This means that your media will play in desktop, tablet and phone devices alike. We also use their standard players (not custom \'skins\' or players) to ensure the maximum flexibility and compatibility. Conversely, embedding media means also embedding a range of possible players, skins, and script files to account for different devices, different browser capabilities, and so on (in most cases duplicating the media in multiple formats): it\'s much harder, more bug-prone, less customisable, and makes huge files which you then have to deal with.\r\n\r\nUsing streaming services is *cheaper for you*: It saves your servers bandwidth (data-transfer quota and costs per megabyte) from serving potentially large media files. Media is uploaded only once - but can be used in multiple courses and sites, in formats that are correct for the clients browsers or devices. If changes are made to the media, all courses and sites using that media will all automatically get the most current version of the material.'),
	(8,2,4,'uk-background-muted','#ffffff','## Setting it up in a LMS\r\n<ul>\r\n    <li>Make sure you are embedding this into a SCORM-compliant LMS.</li>\r\n    <li>Base your completion on the SCORE rather than a lesson_status (because the completed / passed status is buggy in a number of LMS\'s due to ambiguity in the SCORM specification).</li>\r\n    <li>Set the completion required score to the <u>percentage watched</u> that is set for the video (shown when you set a marker).</li>\r\n</ul>'),
	(9,3,1,'cs-section-intro',NULL,'## Build amazing courses (not just slideshows)\r\n\r\nCourseBuilder Ninja is not a slideshow converter. It is a fully featured course and quiz editor that lets you create rich, interactive HTML5 courses without knowing HTML or using esoteric Flash-based builders. You might have used tools that simply convert your PowerPoint presentations into static slideshows - you get courses without much interaction. Courses are ineffective communicators without interaction; CourseBuilder Ninja is *all about* interaction.\r\n\r\nCourseBuilder Ninja produces SCORM 1.2 or SCORM 2004 compatible courses that play on all your platforms - no more publishing multiple packages for each platform, or bundling extra code or hacks for just one device. Everything works the same everywhere. Courses are always responsive.\r\n\r\n## Interactions\r\nYou can quickly add visual elements to your courses such as tab bars, expanding sections (accordions), slideshows, popup video, references and term definitions, balloon tips, flip-cards, inline quizzes and much more - all without knowing any scripting language or HTML.\r\n\r\n## More uses\r\nWe use this product internally and have developed it over a number of years and continue to produce course material using the tool. As we need new features or interactions, we add them in. Every time you download or preview a course, it gets updated to the latest code and includes the latest suite of interactions.\r\n\r\nMultiple users can work on the same course at the same time. Publishing a course takes minutes and the courses themselves are typically only a few MB\'s in size. The built-in preview page hosts a simple SCORM API to emulate the package as it appears in a LMS environment, letting you test out suspending the session or how it appears at different screen resolutions.\r\n\r\n## Frequently asked stuff\r\n<details>\r\n      <summary>Why would I want to track videos with SCORM?</summary>\r\n      <p>Let\'s say your learners need to watch material in order to gain a Continuing Professional Development (CPD) credit. Their industries\' rules state that they need to watch at least 45 minutes of a 1 hour video in order to gain 1 point. </p>\r\n      <p>The tool lets you do that. You can specify a video URL, set the completion requirement to 75%, and publish it as a SCORM package. You then just drop this into your LMS and start recording the completions.</p>\r\n      <p>We also record how much of the video has been watched. This has two benefits - <em>for the learner</em> it means they can exit the activity and come back another time and have the video pick back up where they left off; and <em>for the trainer</em> it means you can report on exactly how much of the media an individual is actually watching or listening to.</p>\r\n</details>\r\n'),
