	(12,1,1,'cs-whacky-slideshow uk-light nice-blue-gradient','#ffffff','### Where are the slideshows? Here.\r\n\r\n<div uk-lightbox=\'animation:0\' class=\'uk-child-width-1-3@m uk-child-width-1-1@s uk-child-width-1-4@xl\' uk-grid>\r\n <div>\r\n  <a class=\'uk-inline uk-box-shadow-small uk-box-shadow-hover-large\' caption=\'file\' href=\'https://coursesuite.ninja.test/img/dbbe289ab13034d623d825897025b0e0.png\'><img src=\'/content/image/L2ltZy9kYmJlMjg5YWIxMzAzNGQ2MjNkODI1ODk3MDI1YjBlMC5wbmc=/270/\' alt=\'file\'><br>Cats</a>\r\n</div>\r\n <div>\r\n  <a class=\'uk-inline uk-box-shadow-small uk-box-shadow-hover-large\' caption=\'file\' href=\'https://coursesuite.ninja.test/img/5e28c66e5fe3d01a160459eec55f401b.png\'><img src=\'/content/image/L2ltZy81ZTI4YzY2ZTVmZTNkMDFhMTYwNDU5ZWVjNTVmNDAxYi5wbmc=/270/\' alt=\'file\'><br>Dogs</a>\r\n</div>\r\n <div>\r\n  <a class=\'uk-inline uk-box-shadow-small uk-box-shadow-hover-large\' caption=\'file\' href=\'https://coursesuite.ninja.test/img/a2d2261a7be567d14103261be48b58ff.png\'><img src=\'/content/image/L2ltZy9hMmQyMjYxYTdiZTU2N2QxNDEwMzI2MWJlNDhiNThmZi5wbmc=/270/\' alt=\'file\'><br>Birds</a>\r\n</div>\r\n <div>\r\n  <a class=\'uk-inline uk-box-shadow-small uk-box-shadow-hover-large\' caption=\'file\' href=\'https://coursesuite.ninja.test/img/dc6d03335824fe21bcb4bf4b362c6b4d.png\'><img src=\'/content/image/L2ltZy9kYzZkMDMzMzU4MjRmZTIxYmNiNGJmNGIzNjJjNmI0ZC5wbmc=/270/\' alt=\'file\'><br>Rocks</a>\r\n</div>\r\n</div>\r\n\r\n### want another slideshow?\r\n\r\n<div uk-lightbox=\'animation:1\' class=\'uk-child-width-1-3@m uk-child-width-1-1@s uk-child-width-1-4@xl\' uk-grid>\r\n <div>\r\n  <a class=\'uk-inline uk-box-shadow-small uk-box-shadow-hover-large\' caption=\'file\' href=\'https://coursesuite.ninja.test/img/2b3ee6d2c9ca06efbd8dda679e6c2fc5.png\'><img src=\'/content/image/L2ltZy8yYjNlZTZkMmM5Y2EwNmVmYmQ4ZGRhNjc5ZTZjMmZjNS5wbmc=/270/\' alt=\'file\'></a>\r\n</div>\r\n <div>\r\n  <a class=\'uk-inline uk-box-shadow-small uk-box-shadow