	(13,2,1,'cs-section-intro','#ffffff','## Add completions to videos.\r\n\r\nMedia Ninja lets you watch a video (or listen to an audio file) then get a completion after you reach a certain amount\r\n\r\n## How does it work?\r\n\r\nThis tool will wrap content that is hosted by streaming providers such as YouTube and Vimeo in a special player that knows how far through a user has watched. You can optionally hide the \"scrubber\" bar (the draggable item that lets users skip ahead or back in a video) so your learners can\'t skip ahead. You then simply set a condition regarding when to mark the media as completed - typically by setting a time/percentage watched. After that marker is reached, we send a SCORM completion to your LMS.\r\n\r\n## Why only support streaming media?\r\n\r\nBrightCove, YouTube, Vimeo and SoundCloud all work very hard to support the widest range of browsers and platforms for their content - its in their best interest. This means that your media will play in desktop, tablet and phone devices alike. We also use their standard players (not custom \'skins\' or players) to ensure the maximum flexibility and compatibility. Conversely, embedding media means also embedding a range of possible players, skins, and script files to account for different devices, different browser capabilities, and so on (in most cases duplicating the media in multiple formats): it\'s much harder, more bug-prone, less customisable, and makes huge files which you then have to deal with.\r\n\r\nUsing streaming services is *cheaper for you*: It saves your servers bandwidth (data-transfer quota and costs per megabyte) from serving potentially large media files. Media is uploaded only once - but can be used in multiple courses and sites, in formats that are correct for the clients browsers or devices. If changes are made to the media, all courses and sites using that media will all automatically get the most current version of the material.'),
	(14,2,3,'cs-section-faq cs-background-starburst','#ffffff','## Frequently asked stuff\r\n<details>\r\n      <summary>Why would I want to track videos with SCORM?</summary>\r\n      <p>Let\'s say your learners need to watch material in order to gain a Continuing Professional Development (CPD) credit. Their industries\' rules state that they need to watch at least 45 minutes of a 1 hour video in order to gain 1 point. </p>\r\n      <p>The tool lets you do that. You can specify a video URL, set the completion requirement to 75%, and publish it as a SCORM package. You then just drop this into your LMS and start recording the completions.</p>\r\n      <p>We also record how much of the video has been watched. This has two benefits - <em>for the learner</em> it means they can exit the activity and come back another time and have the video pick back up where they left off; and <em>for the trainer</em> it means you can report on exactly how much of the media an individual is actually watching or listening to.</p>\r\n</details>\r\n<details>\r\n      <summary>What SCORM version do you publish to?</summary>\r\n      <p>We package using SCORM 1.2, as it is the most widely implemented version.</p>\r\n</details>\r\n<details>\r\n      <summary>What are the video sizes?</summary>\r\n      <p>It\'s generally recommended to use the Responsive size, as this means the video will scale to fit its container whilst maintaining a 16:9 aspect ratio.</p>\r\n      <p>Media sizes are taken from the default options for each of the players\' embed options. These are:</p>\r\n      <ul>\r\n            <li><b>YouTube</b> - Small: 560px x 315px, Large: 853px x 480px, Responsive: 100% x 56.25%</li>\r\n            <li><b>Vimeo</b> - Small: 500px x 281px, Large: 960px x 540px, Responsive: 100% x 56.25%</li>\r\n            <li><b>SoundCloud</b> - Small: 100% x 166px (Standard layout), Large: 100% x 450px (Visual layout), Responsive: 100% x 56.25% (Visual layout)</li>\r\n            <li><b>BrightCove</b> - Small: 512px x 288px, Large: 768px x 432px, Responsive: 100% x 56.25% (16:9)</li>\r\n      </ul>\r\n</details>\r\n<details>\r\n      <summary>Which Learning Management Systems do you support?</summary>\r\n      <p>Any SCORM 1.2 compliant LMS, such as Moodle, Janison CLS,Course Cloud, Totara, Scorm Cloud, Blackboard, or hundreds of others.</p>\r\n</details>\r\n<details>\r\n      <summary>What if a learner only watches some of the video and returns later to watch the rest?</summary>\r\n      <p>They will resume the video or sound file at the exact moment they left the package when they return -and their completion will occur when they reach the desired percentage of media to be viewed.</p>\r\n</details>\r\n<details>\r\n      <summary>What about privacy? I don’t want the whole world being able to access our videos.</summary>\r\n      <p>You need to consult the options for your video host. For instance, some Vimeo accounts can restrict which domains are able to watch the video.</p>\r\n</details>\r\n<details>\r\n      <summary>Do I need to download any software to use this app?</summary>\r\n      <p>Since it is web based, it requires no installation or any plugins</p>\r\n</details>\r\n<details>\r\n      <summary>How do I embed BrightCove video?</summary>\r\n      <p>Ok, this one is a little involved. BrightCove has a concept called Players, which are skins for the various videos. Each video can be published with one or more skins, and you can set up multiple players. One of these is a HTML5 player, and in it you must also specify that the player use API\'s and HTML5 delivery. Please refer to the BrightCove documentation about how to do this.</p>\r\n      <p class=\"text-center\"><img src=\"/img/brightcove_player.png\"></p>\r\n      <p>Some brightcove player embed codes look like this: <em>http://bcove.me/u4bjl68t</em> - we can\'t support this format since it doesn\'t identify which player will be used (it *might* be one with an API enabled, but there isn\'t a way to know). So you have to use the <b>javascript</b> embed code, which you can find in the Quick Video Publish tool:</p>\r\n      <p class=\"text-center\"><img src=\"/img/brightcove_publish.png\"></p>\r\n</details>\r\n\r\n<details>\r\n      <summary>Why the Ninja?</summary>\r\n      <p>Because it’s cool. We like ninjas.</p>\r\n</details>'),
	(15,2,5,'uk-background-muted','#ffffff','## Setting it up in a LMS\r\n<ul>\r\n    <li>Make sure you are embedding this into a SCORM-compliant LMS.</li>\r\n    <li>Base your completion on the SCORE rather than a lesson_status (because the completed / passed status is buggy in a number of LMS\'s due to ambiguity in the SCORM specification).</li>\r\n    <li>Set the completion required score to the <u>percentage watched</u> that is set for the video (shown when you set a marker).</li>\r\n</ul>'),
	(16,2,7,'cs-section-engine','#ffffff','## Under the hood\r\nSo you might be wondering what the innards of this thing actually are (how it works). It uses a minimal SCORM 1.2 based engine that, like most wrappers, expects the SCORM API to exist in a parent frame or window. It also has hand-coded listeners that tap the player API\'s that BrightCove, YouTube, Vimeo and SoundCloud expose on order to capture information about the media being played. These wrappers call SCORM commands as the media plays.\r\n\r\n<details>\r\n    <summary>Click here for all the gory details</summary></p>\r\n    <ol>\r\n        <li><b>onload</b>:<ol>\r\n            <li>perform a scorm initialise (gets the api)</li>\r\n            <li>read <em>cmi.core.entry</em> (set to ab-initio on first launch)</li>\r\n            <li>read <em>cmi.core.lesson_location</em> (last position in video)</li>\r\n        </ol></li>\r\n        <li><b>on video start</b>:<ol>\r\n            <li>set <em>cmi.core.exit</em> to \"suspend\"</li>\r\n            <li>set <em>cmi.core.lesson_status</em> to \"incomplete\"</li>\r\n            <li>perform a scorm commit</li>\r\n        </ol></li>\r\n        <li><b>periodically</b> (as video is playing):<ol>\r\n            <li>set <em>cmi.core.lesson_location</em> to the number of seconds the video is up to. You can use this value to check how much a learner actually viewed through to.</li>\r\n            <li>Check the required amount to be watched, and if it matches or is greater, perform a completion (see below).</li>\r\n        </ol></li>\r\n        <li><b>on pause, rebuffer, or end</b>:<ol>\r\n            <li>Call LMS Commit to persist the changed data (e.g. seconds played)</li>\r\n        </ol></li>\r\n        <li><b>on completion</b>:<ol>\r\n            <li>set <em>cmi.core.exit</em> to \"\" (blank string, effectively means \"logout\" according to the SCORM spec)</li>\r\n            <li>set <em>cmi.core.lesson_status</em> to \"completed\"</li>\r\n            <li>set <em>cmi.core.score.min</em> to \"0\"</li>\r\n            <li>set <em>cmi.core.score.max</em> to \"100\"</li>\r\n            <li>set <em>cmi.core.score.raw</em> to the required percentage</li>\r\n            <li>perform a scorm commit</li>\r\n        </ol></li>\r\n        <li><b>onunload</b>:<ol>\r\n            <li>perform a scorm commit</li>\r\n            <li>perform a scorm finish</li>\r\n        </ol></li>\r\n    </ol>\r\n    <p>Effectively, this means the video is able to be resumed from the point the learner leaves, as <em>lesson_location</em> is being stored. It also means that the score required for completion in your LMS is the same percentage that needs to be watched.</p>\r\n</details>');
