	(1,'docninja','Document Ninja','Add a SCORM wrapper to your existing content by converting it to modern, industry standard device-ready HTML5','Document Scormification Ninja is a web-based app that converts documents from a variety of common formats into HTML5 and adds a simple SCORM wrapper for page completion tracking.','/img/apps/document-ninja.png',NULL,'http://documentninja.coursesuite.ninja/app/?hash=%s','https://guide.coursesuite.ninja/documentninja/usage',0,'2018-04-12 13:30:42',1,NULL,'','[\r\n    {\r\n        \"href\": \"\\/img\\/apps\\/docninja\\/c2e30d01567e6b7d999b580d265e837e.png\",\r\n        \"thumb\": \"\\/img\\/apps\\/docninja\\/c2e30d01567e6b7d999b580d265e837e.png_thumb459.jpg\",\r\n        \"caption\": \"A simple interface with no complex or hidden settings\"\r\n    },\r\n    {\r\n        \"thumb\": \"https:\\/\\/i.ytimg.com\\/vi\\/LttxcCEW1j0\\/hqdefault.jpg\",\r\n        \"href\": \"https:\\/\\/www.youtube.com\\/watch?v=LttxcCEW1j0&rel=0&showinfo=0&iv_load_policy=3\",\r\n        \"caption\": \"Become a Scorm Ninja today!\"\r\n    },\r\n    {\r\n        \"href\": \"\\/img\\/apps\\/docninja\\/7e26143bd96dee865cc92a7aef21c77c.png\",\r\n        \"thumb\": \"\\/img\\/apps\\/docninja\\/7e26143bd96dee865cc92a7aef21c77c.png_thumb459.jpg\",\r\n        \"caption\": \"Uncomplicated themes and colour choices for your published packages\"\r\n    },\r\n    {\r\n        \"href\": \"\\/img\\/apps\\/docninja\\/0eb00414777507096c0b78c8cedf2f7a.png\",\r\n        \"thumb\": \"\\/img\\/apps\\/docninja\\/0eb00414777507096c0b78c8cedf2f7a.png_thumb459.jpg\",\r\n        \"caption\": \"Straightforward SCORM settings for progression and completion\"\r\n    },\r\n    {\r\n        \"href\": \"https:\\/\\/www.youtube.com\\/watch?v=OF1Q3_r_9mc&rel=0&showinfo=0&iv_load_policy=3&enablejsapi=1\",\r\n        \"thumb\": \"https:\\/\\/i.ytimg.com\\/vi\\/OF1Q3_r_9mc\\/hqdefault.jpg\",\r\n        \"caption\": \"Tutorial: Converting a Moodle Book to a SCORM package\"\r\n    },\r\n  