	(2,'vidninja','Media Ninja','Get a SCORM completion for watching some or all of from your streaming media. ','The Media Scormification Ninja converts your streaming video or audio file to a SCORM package, so that you can get a completion after the user watches a certain amount of the media.','/img/apps/media-ninja.png',NULL,'http://medianinja.coursesuite.ninja/app/?hash=%s','https://guide.coursesuite.ninja/medianinja/usage',0,'2018-04-12 13:51:25',1,NULL,'','[\r\n    {\r\n        \"video\": \"https:\\/\\/www.youtube.com\\/watch?v=kxnd_-GlF_M&rel=0&showinfo=0&iv_load_policy=3\",\r\n        \"thumb\": \"https:\\/\\/i.ytimg.com\\/vi\\/kxnd_-GlF_M\\/hqdefault.jpg\",\r\n        \"caption\": \"Media Ninja - What is it?\"\r\n    },\r\n    {\r\n        \"thumb\": \"\\/img\\/apps\\/vidninja\\/5946f496d89745e691b77b26ddc57532.png_thumb400.jpg\",\r\n        \"href\": \"\\/img\\/apps\\/vidninja\\/5946f496d89745e691b77b26ddc57532.png\",\r\n        \"caption\": \"Uncluttered options - only what you need\"\r\n    },\r\n    {\r\n        \"thumb\": \"\\/img\\/apps\\/vidninja\\/811fe1b1f9ec6bd3de36c3e675210202.png_thumb400.jpg\",\r\n        \"href\": \"\\/img\\/apps\\/vidninja\\/811fe1b1f9ec6bd3de36c3e675210202.png\",\r\n        \"caption\": \"Specify a video and when it completes - simple.\"\r\n    }\r\n]','convert audio to SCORM, scorm completion, add completions to video, scorm compliant video format, scorm converter, youtube, vimeo, soundcloud','yolo The Media Ninja is a SCORM converter tool that will wrap content that is hosted on streaming providers in a special player that knows how far through a user has watched. Start your free trial today.','​Convert video and audio files to a SCORM package | CourseSuite Media Ninja',0,'#993300','<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<svg version=\"1.1\" id=\"Layer_1\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" x=\"0px\" y=\"0px\"\r\n	 viewBox=\"0 0 76 76\" style=\"enable-background:new 0 0 76