	(15,'presninja','Audio Presentation Ninja','Add audio to your scorm-enabled presentations','Add a chaptered audio track to your scorm-enabled presentations','/img/apps/presentation-ninja.png','','http://apresninja.coursesuite.ninja.test/app/?hash=%s','https://guide.coursesuite.ninja/presentationninja/usage',0,'2018-02-27 14:11:44',1,0,'## scenario\nYou have just been presenting your Google Slides or Powerpoint presentation standing up at the front of the lecture hall, and to keep things simple just recorded your own voice using your phone\'s voice recorder function. Now you want to make it all available to your learners. You\'re about to attach the presentation and the audio recording into your LMS as seperate files. Or maybe you\'ve got Adobe Premiere installed so you\'ll render the presentation and its audio to a video stream and put it all up on YouTube, then link to the video: that might take hours.\n\n## simplify.\n\nThe Audio Presentation Ninja lets you synchnoise your recorded audio track with the slides from your presentation, just by dragging the presentation and the audio into your browser. You can even record your voice directly in the browser from your computer\'s microphone.\n\nThe result is packaged in a neat, SCORM-compatible package, ready for your LMS.\n\n## how?\n\nWith our simple tool, you simply drop on your presentation (we support PowerPoint, KeyNote, Open Office or PDF files, and SlideShare or Google Slides URL\'s). We\'ll grab the slides and convert them to HTML5 and add code so they scale to fit the users screen. You also drop on your recorded audio file on (we support Ogg, Mp3, Wma, Aif, Wav and Webm) and we\'ll also transcode those to HTML5-compatible formats.\n\n![adjusting slide change markers](/img/apps/presninja/3a419bf3ea09fa46b087544951bc6549.gif)\n\nYou can then adjust the timestamps (cue points) that denote when the presentation slides should change to sync with the audio. Then you just set the basic options and download the finished result, ready to publish to your LMS or web site.\n\nWe also allow you to enter the timestamps / page turns in using standard WEBVTT format, so if you already have caption or chapter data for your audio you can paste that in and we\'ll combine that with the slide-change marker data.\n\nThen, you just choose a couple of simple design choices, download and *you\'re golden*. The package plays back using standard HTML5 technology, allows users to skip easily through slides and synchronises the audio, and includes full-screen support to best show off your presentation.','[\r\n    {\r\n        \"thumb\": \"\\/img\\/apps\\/apresninja\\/901edc4ac1c06e14b2318d45c810a0e2.png_thumb400.jpg\",\r\n        \"href\": \"\\/img\\/apps\\/apresninja\\/901edc4ac1c06e14b2318d45c810a0e2.png\",\r\n        \"caption\": \"\"\r\n    },\r\n    {\r\n        \"thumb\": \"\\/img\\/apps\\/apresninja\\/a43a6ba6014d32a56e27a95bbbf647fd.jpg_thumb400.jpg\",\r\n        \"href\": \"\\/img\\/apps\\/apresninja\\/a43a6ba6014d32a56e27a95bbbf647fd.jpg\",\r\n        \"caption\": \"\"\r\n    }\r\n]','','','',0,'#ea8067','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<svg version=\"1.1\" id=\"Layer_1\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" x=\"0px\" y=\"0px\"\r\n	 viewBox=\"0 0 250 250\" style=\"enable-background:new 0 0 250 250; xml:space=\"preserve\">\n<path d=\"M171.47,52.66a66.38,66.38,0,0,0-129.89,0H171.47Z\"/><path d=\"M98.57,74.54C97.1,68,90.88,63,83.42,63S69.75,68,68.27,74.54h30.3Z\"/><path d=\"M144.78,74.54C143.31,68,137.08,63,129.63,63S116,68,114.48,74.54h30.3Z\"/><path d=\"M139.68,136.9c0.66-14.76,3.51-28.9,12.26-41.23,7.42-10.45,17.55-15.47,30.48-14.63,10.26,0.67,18.11,6.61,20.12,16,2,9.1.52,17.52-6.69,24.14-4,3.65-8.76,5.47-14.07,3.95-10.9-3.13-19.51,1-27.32,8a75.13,75.13,0,0,0-11.92,14.35c-0.32.48-.77,1.42-1.24,1.2a3.45,3.45,0,0,1-.61-1.5A48.53,48.53,0,0,1,139.68,136.9Z\"/><path d=\"M204.57,77.76A53,53,0,0,1,220.26,85c10.51,6.8,19.52,15.11,25.37,26.38s