	(17,'api','API','Access to all apps via code','','/img/apps/api/cdc92c867d30704552bcdad8ab080c56.png','','',NULL,0,'2018-02-27 14:12:19',0,0,'API Access is a special subscription that grants you the ability to connect to all our apps at their higest tiers and allows you to access extra features such as direct publishing to Moodle (requires a free plugin) or to your portal, etc.\r\n\r\nYou are able to \"white label\" the apps - which is a fancy term for changing the header to your liking (maybe your own organisations colours or logo). The design and functionality of the apps themselves, including watermarking, will remain branded by CourseSuite.\r\n\r\nLaunching the apps via the API requires a special code which you can implement into your portal or custom front end, or by our Moodle block plugin. Code samples are available on our Git repository.\n\nBuy purchasing this product you agree that you are using the service as an individual or on behalf of a single organisation. You are only able to hold one API subscription service at a time.','null','','','',0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<svg version=\"1.1\" id=\"Layer_1\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" x=\"0px\" y=\"0px\"\r\n	 viewBox=\"0 0 250 250\" style=\"enable-background:new 0 0 250 250; xml:space=\"preserve\">\n<path d=\"M171.47,52.66a66.38,66.38,0,0,0-129.89,0H171.47Z\"/><path d=\"M98.57,74.54C97.1,68,90.88,63,83.42,63S69.75,68,68.27,74.54h30.3Z\"/><path d=\"M144.78,74.54C143.31,68,137.08,63,129.63,63S116,68,114.48,74.54h30.3Z\"/><path d=\"M139.68,136.9c0.66-14.76,3.51-28.9,12.26-41.23,7.42-10.45,17.55-15.47,30.48-14.63,10.26,0.67,18.11,6.61,20.12,16,2,9.1.52,17.52-6.69,24.14-4,3.65-8.76,5.47-14.07,3.95-10.9-3.13-19.51,1-27.32,8a75.13,75.13,0,0,0-11.92,14.35c-0.32.48-.77,1.42-1.24,1.2a3.45,3.45,0,0,1-.61-1.5A48.53,48.53,0,0,1,139.68,136.9Z\"/><path d=\"M204.57,77.76A53,53,0,0,1,220.26,85c10.51,6.8,19.52,15.11,25.37,26.38s6,22.55-.57,33.64c-7