INSERT INTO `blogentries` (`entry_id`, `title`, `slug`, `long_entry`, `short_entry`, `meta_description`, `entry_date`, `published`)
VALUES
	(28,'A new way to buy','a-new-way-to-buy',NULL,'We have updated our payment options so that you are now able to buy NinjaSuite apps individually or as a bundle, and at the feature tier that suits you.\n\nPreviously, we only offered NinjaSuite as all the apps at one price for each tier, but we listened to your feedback and re-imagined the system so that it now allows the purchase of individual apps and at each feature tier level. This means you can now pick and choose the apps that you need at the prices that you can afford.\n\nApps still are tiered. The way this works is:\n\n* The lowest tier is the cheapest\n* With most products, courses produced with the lowest tier contains some kind of basic watermark or copyright statement that mentions or links back to CourseSuite.\n* Higher tiers extend the feature set, plus remove watermarks and other details. Consult each product page for more information about the tiers related to that product.\n\nYou\'re also able to buy bundles of apps at a discounted price; different bundles contain two or more apps each at various tiers, and are priced accordingly.\n\nWe\'ve also heavily revised our pricing model to make your subscription dollars go further.','CourseSuite now allows products to be bought individually or bundled','2017-03-04 16:58:32',1),
	(29,'We\'re secure','we-are-secure','','Ok, I\'ll admit it. Getting SSL running across the whole domain took longer than it should have. Now all of our CourseSuite sites (web, payment gateway, forum, helpdesk, apps, etc) are running and communicating securely all the time using the latest web technologies and encryption schemes - all for keeping you and your data safe.\r\n\r\nLook for the lock in your browsers location bar!',NULL,'2017-03-06 19:28:38',1),
	(30,'Document Ninja Templates','document-ninja-templates','','The Document Ninja template selector has had a much-needed revamp, and we\'re soon adding some premium player skins for Pro users so you can give these simple courses fancy designs.\r\n\r\n![file](https://www.coursesuite.ninja/img/25d5d6d8db836a12dabfc414bdcc9ab4.png)\r\n\r\nIn the meantime, we\'ve redesigned the theme selector with one thing in mind: *simplicity*. You can choose a colour and a layout kind, and we do the rest. Like the rest of the Document Ninja, we like to keep things uncomplicated (less is more, and all that).\r\n\r\nYou can read more about the new designs in the [guides](https://guide.coursesuite.ninja/documentninja/usage/choose-design/navigation-groups).',NULL,'2017-03-09 10:29:35',1),
	(31,'Document Ninja - Pro Tier Designs','document-ninja-pro-tier-designs','','Today we pushed out a new feature to all Document Ninja Pro-Tier subscribers - pre-built designs. When choosing a design for your courses, you can use the existing \"basic\" designs, or choose one of our ever-expanding list of pre-built designs.\r\n\r\n![file](https://www.coursesuite.ninja/img/8daaed602a5028d615eef8d32305ab08.jpg)\r\n\r\nWe\'ll be adding new designs and colour variants over time, so be sure to check back now and then. Your feedback is welcome - just join a conversation.\r\n\r\nAs a bonus you can even edit the code, html and css of our basic designs using the *Advanced* tab to use your own styles or colours as you see fit.',NULL,'2017-05-25 12:29:13',1),
	(32,'Scorm Preview Ninja','scorm-preview-ninja','','We\'ve had the Scorm Debug Ninja up for a while now, but today we\'ve re-released it with a little more functionality as well as an easier to understand interface. No more opening the developer console to look at the SCORM api calls - it\'s right there on a tab. You can also try out different sizes. It remembers your packages for a couple of days then clears them out automatically (or you can delete them yourself).\r\n\r\n<img src=\"https://www.coursesuite.ninja/img/50209354de559eca083063a556c3a1bf.jpg\" style=\"max-width:100%\">\r\n\r\nBest of all, it\'s free to use - find it on the [Freebies](https://www.coursesuite.ninja/freebies) tab.',NULL,'2017-08-09 09:00:00',1),
	(33,'Many minor updates','many-minor-updates','Apps have also had a number of changes and bugfixes.\r\n\r\n## Document Ninja\r\n\r\n* Converting Google Slides now supported\r\n* Split documents by default (settable by option)\r\n* Other settings added (see little cog at the top right)\r\n* Squashed a long-standing bug with completion of multiple videos\r\n* Automatically scale and optimise large images pasted in / uploaded\r\n* Fixed embedding images and galleries from imgur.com\r\n* Fixed various template issues with Edge browser\r\n* Changed SoundCloud output renderer for responsive design\r\n\r\n## Video Ninja\r\n\r\n* Added preview to source screen so you can be sure that you\'re loading the correct video\r\n* Changed some design options for clarity of purpose\r\n* Updated internal templates for better readability (for the code tinkerers out there)\r\n* *Removed* BrightCove support (overhead in maintenance / hardly ever got used). Let us know if you need it!\r\n\r\n## CourseBuilder\r\n\r\n* Fixed an issue with embedding YouTube / Vimeo content\r\n* Implemented support for forthcoming API\r\n* Many internal fixes... nothing you\'d notice (hopefully)\r\n\r\n## Scorm Previewer\r\n\r\n* Fixed file upload (affected Firefox and Edge)\r\n* Better logging display\r\n* Better resizing options\r\n','We have simplified the way that users log in to CourseSuite, added support for launching apps through an API, and made a bunch of minor changes or bug fixes across our apps.\r\n\r\n## Logging on\r\nYou might have noticed that to sign in or register for the site, all you need to do is supply a valid email address. You are then assigned a password which you can use once to log into the site. We threw away the need to register and verify an email, then get a password and manage that password - the new approach is compatible with the old and means there\'s less for you to manage. We always need a valid email address, so that\'s rolled into the new system.\r\n\r\n## API\r\n\r\nThe [CourseSuite API](/apidoc/) lets you externally authenticate and launch apps. API access will allow multiple concurrent users in the apps, give access to all apps and at their highest tier, and allow a degree of customisation to the appearance of apps. The API will be made available to the public soon!',NULL,'2017-11-01 14:19:18',1),
	(34,'New Client Builds Over 60 Courses in a Week','client-builds-60-courses-in-a-week','They did have to put their heads down and work hard, but they achieved their goal and had the new SCORM courses loaded on to their Moodle LMS. They had students accessing the courses and achieving certification all within 2 weeks of starting the migration process. We also customised, themed and implemented the Moodle LMS for them.\r\n\r\nEach course is now fully HTML5 SCORM compliant and, as such, the client will never have this migration issue again as the courses will now work on any SCORM compliant LMS.  ','Recently a large Australian Nursing organisation with over 300,000 members needed to rebuild over 60 of their old existing courses to migrate to a brand new system. They needed to build all of their new courses within 2 weeks because their old system was being turned off. And they only had one staff member available to build the new courses.\r\n\r\nWe initially helped them to create the first course in our CourseBuilder Ninja as a template - and, from there, they cloned it many times. They adapted each new course with the respective content and exported them as HTML5 SCORM courses. \r\n\r\nManaging all the courses was made easy in our easy to use course catalogue landing page.\r\n\r\n<img src=\"http://i.imgur.com/aXxybfGm.jpeg\" style=\"max-width:100%\">',NULL,'2017-11-02 14:12:44',1),
	(35,'Version Bump!','version-bump','','We\'ve simplified the purchasing options by eliminating Tiers. You now get the apps with all their features. Oh, and we\'re also working on new apps - more on that soon.\r\n\r\nIf you\'re an existing subscriber at a lower tier, you\'ll now notice your app is at the higher tier (but your subscription price will stay the same - lucky ducks!).',NULL,'2017-12-01 11:41:02',1),
	(36,'New API access up and running','new-api-up-and-running','The API system is allowing company management to purchase subscriptions to our software for its employees at a centralised place, providing them with all financial and licensing control.  \r\n\r\nMore advancements coming in the API areas soon, stay in touch!\r\n\r\nContact us if you want us to help you integrate it into your system.\r\n\r\n*We\'re always here to help*','A new API client has selected CourseSuite as their primary content development company. Western Victoria Primary Health Network (PHN) has come on board and is now able to enjoy our new API subscription services and support. \r\n\r\nUtilising our custom API single sign on integration process, they were able to embed our supplied API code into their Learning Management Portal, now allowing multiple content builders to access our cloud based content building apps and services.\r\n\r\n*No more staff hunting for that company credit card*\r\n\r\n[![Hunt for those company credit cards](https://i.imgur.com/PG0PjXp.jpg)](https://i.imgur.com/Ur5RRbu.jpg){.zoom}\r\n\r\n',NULL,'2018-01-23 12:44:02',1),
	(37,'New API SSO in Action','new-api-in-action','How does it work? a third party portal requests authentication credentials from the CourseSuite site. If the requesting secure token matches a current active subscription then CourseSuite returns the calling portal with an array of data. This then allows 3rd party system to generate the tiles dynamically and with the correct authentication app key associated to each respective CourseSuite App.\r\n\r\n<a href=\"https://www.coursesuite.ninja/apidoc/\" target=\"_blank\">API documentation</a>\r\n\r\nSecure single sign on (SSO), White labeled headers in apps and publish to url are all available features of the API integration. \r\n\r\nContact us if you require more information or want to demo this in action.\r\n\r\n*We\'re always here to help*\r\n\r\n','It\'s been said before but we thought we should show you how the secure CourseSuite API SSO can look and feel on a live portal. As our Ninja Suite of available apps grows in number the list of available app tiles availableon requesting 3rd party portals will grow dynamically with it.\r\n\r\n<img src=\"https://i.imgur.com/AmvwIOa.png\" style=\"max-width:80%\">\r\n\r\n',NULL,'2018-01-31 13:25:58',1),
	(38,'Saving time and money on course development','save-time-money-course-development','\r\n\r\n# How can we save you time and money?\r\nIt\'s easy:\r\n* We are subscription based, so you only need to pay for how long that you want to use the app\r\n* We are in the cloud and your content stays with you.\r\n* There are free trials available, making it easy to try the apps out - 7/10 users have come back and now subscribe\r\n* You can use your preferred development software e.g MS Word, PDF, Google, YouTube etc. Just use the appropriate app to aggregate and convert your content into device ready eLearning.\r\n* No more update expenses, as we roll out updates continually at no further cost\r\n* You can re-use your content or save them as a template for future use\r\n* We are developing new apps and new features, which you will have access to.\r\n\r\nThe Ninja Suite of apps are fast and easy to use, perform powerful HTML5 conversions quickly and are laid out in a easy to use cloud based interface, all allowing you to save money and save you time.','Each time we release new apps more and more people are starting to spread the word. We can save you time and money and we think we\'ll get you telling your friends and colleagues how easy CourseSuite\'s Ninja Suite apps are to use. These simple and powerful apps provide course developers the ability to concentrate on developing their own specific content in the tools that they know best. Choose the best app to suit the purpose, load your content up, then we convert it into HTML5 ready eLearning courses ready to upload to your eLearning portal.\r\n\r\nWe have multiple apps designed for specific eLearning requirements. This saves you time and money. \r\n<a href=\"https://elearningindustry.com/?s=coursesuite\" target=\"_blank\"> \r\n	<img src=\"https://i.imgur.com/GPTg7kn.jpg\" style=\"max-width:80%\">\r\n</a>',NULL,'2018-02-05 13:28:13',1),
	(39,'Services beyond the Ninja Suite','services-beyond-ninjasuite','Our experienced staff can help you in any regards when if comes to eLearning requirements. We let you be the content specialists and we can convert your content into eLearning courses. \r\n\r\n*\"Whether it be a single course or many, we can help you!\"*\r\n\r\nWith each project we manage, we provide the client with full understanding of the project from start to finish and provide post-publishing support.\r\n\r\nSee how we can save you time and money: [Saving money post](\r\nhttps://www.coursesuite.ninja/blog/38)\r\n','## Prefer to outsource the building of your courses? Get us to build your courses\r\nAt CourseSuite, we have experienced staff that can help you build your eLearning content. We have developed a lot of eLearning content and courses for various clients in the past, whilst using our own apps succesfully. Our \'**Ninja Suite**\' is a new suite of apps that was started because we saw a need to develop eLearning content using the latest coding technologies and the latest server specifications, whilst utilising modern browser and device capablities. \r\n\r\nHTML5 is our go-to export code base for all of our content, as we aim to give the best possible user experience on most modern devices.\r\n<img src=\"https://i.imgur.com/y2b6qGz.png\" style=\"max-width:80%\">\r\n\r\nDon\'t forget that we also offer services beyond our \'**Ninja Suite**\' of apps.\r\n',NULL,'2018-02-08 11:39:05',1);
INSERT INTO `changelog` (`id`, `app_id`, `added`, `value`)
VALUES
	(1,1,'2017-11-23 23:37:15','### App related\r\n\r\n* Fixed bug in Firefox drag-to-reorder\r\n* Updated indentation icons\r\n* Added 4 new pro-tier prebuilt designs\r\n* Internal optimisations \r\n\r\n### Content related\r\n\r\n* Fixed a bug in scrolling in Side Bar, Drop-Down and Drop-Up menus\r\n* Added data-compression to cmi.core.suspend_data to help avoid hitting 4000 byte api limit\r\n* Fixed issue when re-loading suspend_data'),
	(2,1,'2017-11-24 19:26:56','### App related\r\n\r\n* Fixed bug in Firefox drag-to-reorder\r\n* Updated indentation icons\r\n* Added 4 new pro-tier prebuilt designs\r\n* Internal optimisations \r\n\r\n### Content related\r\n\r\n* Fixed a bug in scrolling in Side Bar, Drop-Down and Drop-Up menus\r\n* Added data-compression to cmi.core.suspend_data to help avoid hitting 4000 byte api limit\r\n* Fixed issue when re-loading suspend_data'),
	(3,1,'2017-11-01 00:00:00','* Changed licensing model over to new system\r\n* Introduced stubs to allow future updates to push content or messages\r\n* Updated internal scripts inside published package code'),
	(4,1,'2017-05-24 00:00:00','* Offer pro-tier designs\r\n* Built stubs for theme customiser (future undated release)\r\n* Optimise converted PDF files (convert PNG to JPG during save operation to reduce file size)\r\n* Changed timestamping on engine files to avoid cache conflicts'),
	(5,1,'2017-05-19 00:00:00','* Fixed contrasting colours on default templates\r\n* Added Kloudless chooser and saver support for loading/saving packages to cloud services (e.g. Dropbox, Google Drive, etc)\r\n* Changed header styling code to allow easier white-labelling via forthcoming API'),
	(6,1,'2016-09-02 00:00:00','* Added design preview at tier 2\r\n* Bugfixed ticket #608286\r\n* Replaced colour picker\r\n* Added ability to paste any website and convert to a splittable document\r\n* Repositioned watermark on tier 1 published courses'),
	(7,1,'2016-08-26 00:00:00','* Fixed Edge rendering issues\r\n* Changed oembed endpoints due to depreciated third-party libraries\r\n* Many misc small updates'),
	(8,1,'2016-06-24 00:00:00','* Started writing down changelog!\n* Fixed up commit log in git\n* Removed mention of Beta code'),
	(9,2,'2016-07-21 09:43:26','* Initial commit\n* Updated Tier issue'),
	(10,2,'2016-07-25 09:44:10','* Tweaker Plyr version code\r\n* Fixed startup / resize bug'),
	(11,2,'2016-09-02 09:44:49','* Updated media marker message\r\n* Looked at player responsive styles, fixed height bug'),
	(12,2,'2017-08-22 09:51:53','* Updated launch token validator to allow customising header, styles (white-labelling)\n* Cater for https://www.chromestatus.com/features/5647113010544640'),
	(13,2,'2016-07-25 09:46:48','* Updated Plyr version\r\n* Refactored endpoints for gathering video information\r\n* Changed flexbox layout\r\n* Updated templates using object setters instead of janky functions'),
	(14,2,'2016-09-19 09:47:03','* Player max-height bug has been fixed!'),
	(15,2,'2016-10-13 09:47:22','* Re-enabled analytics (un-noticed for ages!)'),
	(16,2,'2017-11-02 09:48:28','* Rewrote many internal functions (optimising)\r\n* Cleaned up code structure\r\n* Updated Plyr version (video skin) in published packages'),
	(17,2,'2017-11-03 09:49:42','* Changed \"hidden / visible\" button over to a drop down for better functional clarity (user feedback)\r\n* Changed the way page scrolling works (video sometimes went off bottom of screen)'),
	(18,3,'2012-06-02 10:00:03','* Initial commit'),
	(19,3,'2017-11-01 10:01:44','* Added support for new licensing model\n* Added API logon support'),
	(20,3,'2017-11-27 13:39:44','* Fixed a rare bug where finding the SCORM api might fail due to a domain boundary (e.g. launched on a domain that references an external domain for playback of content).'),
	(21,1,'2017-12-12 14:41:07','### App Related\r\n* Updated externally targetted links on new documents to include rel=\"noopener\"\r\n* Ensure links are externally targetted on non-split documents\r\n* Fixed spacing between pages on non-split documents\r\n* Fixed webfont problem (icons temporarily vanished!)\r\n* Catch and disallow download attempt while documents are still converting\r\n* Fixed Kloudless integration for loading and saving documents to cloud-based storage sources\r\n* Fixed spaces in downloaded zip name\r\n* Various minor bugs noted after Firefox Quantum update.'),
	(22,2,'2017-12-12 14:41:51','* Fixed Kloudless integration for saving packages to cloud-based storage sources'),
	(26,1,'2018-03-07 20:45:04','added some kind of shit to the thing that does the thing');
