	('footer_col1','### About Us\r\n\r\nWe are an innovative eLearning development company focused on developing a suite of great online web apps that allow rapid creation of interactive and intuitive HTML5-based SCORM courses. We also release Open Source plugins for Moodle, and produce online course content.\r\n\r\n','2018-03-09 11:37:54'),
	('footer_col2','### More information\r\n\r\n[Privacy](/content/privacy) | [Terms & Conditions](/content/terms) | [Avide eLearning](https://www.avide.com.au)\r\n\r\n### Cookie handling policy\r\n\r\nWe use cookies to deliver a customised experience and track usage analytics.','2018-03-09 11:42:36'),
