	('freeTrialDescription','<main>\r\n<div style=\"font-size: .9em\">\r\n\r\n<h4>Register now for a free 2 week trial allowing access to our Ninja Suite of tools.</h4>\r\n\r\n<p>Use our tools and see how easy it is to create, convert and package to industry standard device-ready HTML5.</p>\r\n\r\n<h4>You Get With The Free Trial:</h4>\r\n\r\n<ul>\r\n\r\n<li><b>Media Ninja</b>: Easily create trackable video from your streamed media</li>\r\n\r\n<li><b>Document Ninja</b>: Convert many different file formats and package to industry standard device-ready HTML5 </li>\r\n\r\n<li><b>CourseBuilder Ninja</b>: Jump into the fully fledged course builder – build content, interactions, quizzes and more...</li>\r\n\r\n<li><b> We&apos;re using latest technology</b>: updates and new features are being planned and added all the time </li>\r\n\r\n</ul>\r\n\r\n \r\n\r\n<h4>Purchase a subscription TODAY and receive more features, on going support and full access to our modern content development tools.</h4>\r\n\r\n<p>We offer many more eLearning services and are here to help, just contact us</p>\r\n\r\n</div>\r\n\r\n</main>','2017-02-13 11:11:40'),
