INSERT INTO `static_pages` (`id`, `page_key`, `body_classes`, `content`, `meta_title`, `meta_keywords`, `meta_description`)
VALUES
	(1,'privacy','privacy-statement','## Privacy Policy\r\n\r\nThis Privacy Policy governs the manner in which CourseSuite Pty Ltd collects, uses, maintains and discloses information collected from users (each, a \"User\") of the coursesuite.ninja website (\"Site\"). This privacy policy applies to the Site and all products and services offered by CourseSuite Pty Ltd.\r\n\r\n####Terms\r\nBy accessing the website at http://couresuite.ninja, you are agreeing to be bound by these terms of service, all applicable laws and regulations, and agree that you are responsible for compliance with any applicable local laws. If you do not agree with any of these terms, you are prohibited from using or accessing this site. The materials contained in this website are protected by applicable copyright and trademark law.\r\n\r\n####Disclaimer\r\nThe materials on couresuite\'s website are provided on an \'as is\' basis. couresuite makes no warranties, expressed or implied, and hereby disclaims and negates all other warranties including, without limitation, implied warranties or conditions of merchantability, fitness for a particular purpose, or non-infringement of intellectual property or other violation of rights.\r\nFurther, couresuite does not warrant or make any representations concerning the accuracy, likely results, or reliability of the use of the materials on its website or otherwise relating to such materials or on any sites linked to this site.\r\n\r\n####Limitations\r\nIn no event shall couresuite or its suppliers be liable for any damages (including, without limitation, damages for loss of data or profit, or due to business interruption) arising out of the use or inability to use the materials on couresuite\'s website, even if couresuite or a couresuite authorized representative has been notified orally or in writing of the possibility of such damage. Because some jurisdictions do not allow limitations on implied warranties, or limitations of liability for consequential or incidental damages, these limitations may not apply to you.\r\n\r\n####Accuracy of materials\r\nThe materials appearing on couresuite\'s website could include technical, typographical, or photographic errors. couresuite does not warrant that any of the materials on its website are accurate, complete or current. couresuite may make changes to the materials contained on its website at any time without notice. However couresuite does not make any commitment to update the materials.\r\n\r\n\r\n### Personal identification information\r\nWe may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our site, register on the site, subscribe to the newsletter, and in connection with other activities, services, features or resources we make available on our Site. Users may be asked for, as appropriate, email address. Users may, however, visit our Site anonymously. We will collect personal identification information from Users only if they voluntarily submit such information to us. Users can always refuse to supply personally identification information, except that it may prevent them from engaging in certain Site related activities.\r\n\r\n### Non-personal identification information\r\n\r\nWe may collect non-personal identification information about Users whenever they interact with our Site. Non-personal identification information may include the browser name, the type of computer and technical information about Users means of connection to our Site, such as the operating system and the Internet service providers utilized and other similar information.\r\n\r\n### Web browser cookies\r\n\r\nOur Site may use \"cookies\" to enhance User experience. User\'s web browser places cookies on their hard drive for record-keeping purposes and sometimes to track information about them. User may choose to set their web browser to refuse cookies, or to alert you when cookies are being sent. If they do so, note that some parts of the Site may not function properly.\r\n\r\n### How we use collected information\r\n\r\nCourseSuite Pty Ltd may collect and use Users personal information for the following purposes:\r\n\r\n* -*To improve customer service: *\r\nInformation you provide helps us respond to your customer service requests and support needs more efficiently.\r\n* -*To personalize user experience: *\r\nWe may use information in the aggregate to understand how our Users as a group use the services and resources provided on our Site.\r\n* -*To process payments: *\r\nWe may use the information Users provide about themselves when placing an order only to provide service to that order. We do not share this information with outside parties except to the extent necessary to provide the service.\r\n* -*To send periodic emails: *\r\nWe may use the email address to send them information and updates pertaining to their order. If User decides to opt-in to our mailing list, they will receive emails that may include company news, updates, related product or service information, etc. If at any time the User would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.\r\n\r\n### How we protect your information\r\n\r\nWe adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of your personal information, username, password, transaction information and data stored on our Site.\r\n\r\nSensitive and private data exchange between the Site and its Users happens over a SSL secured communication channel and is encrypted and protected with digital signatures.\r\n\r\nWe implement a variety of security measures when a user enters, submits, or accesses their information to maintain the safety of your personal information.\r\n\r\nAll transactions are processed through a gateway provider and are not stored or processed on our servers.\r\n\r\n### Sharing your personal information\r\n\r\nWe do not sell, trade, or rent Users personal identification information to others. We may share generic aggregated demographic information not linked to any personal identification information regarding visitors and users with our business partners, trusted affiliates and advertisers for the purposes outlined above.We may use third party service providers to help us operate our business and the Site or administer activities on our behalf, such as sending out newsletters or surveys. We may share your information with these third parties for those limited purposes provided that you have given us your permission.\r\n\r\n### Third party websites\r\n\r\nUsers may find advertising or other content on our Site that link to the sites and services of our partners, suppliers, advertisers, sponsors, licensors and other third parties. We do not control the content or links that appear on these sites and are not responsible for the practices employed by websites linked to or from our Site. In addition, these sites or services, including their content and links, may be constantly changing. These sites and services may have their own privacy policies and customer service policies. Browsing and interaction on any other website, including websites which have a link to our Site, is subject to that website\'s own terms and policies.\r\n\r\n### Changes to this privacy policy\r\n\r\nCourseSuite Pty Ltd has the discretion to update this privacy policy at any time. When we do, we will revise the updated date at the bottom of this page. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect. You acknowledge and agree that it is your responsibility to review this privacy policy periodically and become aware of modifications.\r\n\r\n### Your acceptance of these terms\r\n\r\nBy using this Site, you signify your acceptance of this policy. If you do not agree to this policy, please do not use our Site. Your continued use of the Site following the posting of changes to this policy will be deemed your acceptance of those changes.\r\n\r\n### Contacting us\r\n\r\nIf you have any questions about this Privacy Policy, the practices of this site, or your dealings with this site, please contact us at:\r\n\r\n[CourseSuite PTY LTD](http://coursesuite.ninja \"coursesuite.ninja\") <br />\r\n[coursesuite.ninja](http://coursesuite.ninja \"coursesuite.ninja\")\r\n\r\n*Suite 5.2, Innovation Centre Coffs Harbour Education Campus, 363 Hogbin Drive\r\ninfo@coursesuite.com.au*\r\n\r\n*This document was last updated on July 20, 2016*\r\n','CS Privacy statement','Privacy,CourseSuite,Protect,SCORM,eLearning','CourseSuite Privacy Statement  '),
	(2,'support','support-css','## Support\r\n\r\nThis page could be similar to [CS.Exza support](http://cs.exza.com/support.html) but limit it to Video Tutorials, Help Docs, Contact Us. \r\n\r\nThis could be and all in one page or separate pages that \r\n\r\nI like having the popular questions and latest articles as well like [CS.Exza support](http://cs.exza.com/support.html). How do we feel about this?\r\n\r\nWe could hide the contact form in this page [CS.Exza Contact](http://cs.exza.com/supportContact.html). I like Tims contact form more though\r\n','CS Support','CourseSuite Support, help, SCORM,eLearning','CourseSuite Support'),
	(3,'about','about-css','## About Us\r\nCoursesuite is a professional and dynamic company focused on customising, delivering and maintaining highest quality SCORM compliant content and courseware. We have created CourseSuite as a suite of rapid in-browser course authoring tools that allow you to get your content online fast.\r\n\r\n## Our Story\r\n\r\nThis could be page similar to the about section on the current live but just tell the story of course suite with past and future milestones, a bit like the image below\r\n\r\nNah Julie doesnt want this as it can show that we are  small company\r\n\r\n![](http://cdn2.hubspot.net/hub/53/hubfs/moz-about-us.png?t=1466413675487&width=669)\r\n\r\n\r\n','CS About Us','','CourseSuite About Us'),
	(4,'howelse','howelse-css','### How else can we help you?\r\n#### We do more than just create great apps\r\n<div>\r\n                   <ul class=\"timeline\">\r\n                        <li class=\"timeline-inverted\">\r\n                            <div class=\"timeline-image\">\r\n                                <img class=\"img-circle img-responsive\" src=\"/img/howelse/set2_1.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"timeline-panel\">\r\n                                <div class=\"timeline-heading\">\r\n                                    <h4>I need a new Learning Management System</h4>\r\n                                </div>\r\n                                <div class=\"timeline-body\">\r\n                                    <p class=\"text-muted\">We project manage and develop for new Moodle builds, migrations and upgrades. Let us show you how painless it can be to set up a new eLearning portal.</p>\r\n                                </div>\r\n                            </div>\r\n                        </li>\r\n                        <li>\r\n                            <div class=\"timeline-image\">\r\n                                <img class=\"img-circle img-responsive\" src=\"/img/howelse/set2_2.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"timeline-panel\">\r\n                                <div class=\"timeline-heading\">\r\n                                    <h4>I need course building software</h4>\r\n                                </div>\r\n                                <div class=\"timeline-body\">\r\n                                    <p class=\"text-muted\">With our simple to use course building software you can build interactive HTML5 SCORM courses that will run on both desktop and tablet devices from the one file.</p>\r\n                                </div>\r\n                            </div>\r\n                        </li>\r\n                        <li class=\"timeline-inverted\">\r\n                            <div class=\"timeline-image\">\r\n                                <img class=\"img-circle img-responsive\" src=\"/img/howelse/set2_3.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"timeline-panel\">\r\n                                <div class=\"timeline-heading\">\r\n                                    <h4>I need to purchase ready-made courses</h4>\r\n                                </div>\r\n                                <div class=\"timeline-body\">\r\n                                    <p class=\"text-muted\">Get up and running quickly. We work with many content providers to allow you to provide your learners with industry relevant content instantly.</p>\r\n                                </div>\r\n                            </div>\r\n                        </li>\r\n                        <li>\r\n                            <div class=\"timeline-image\">\r\n                                <img class=\"img-circle img-responsive\" src=\"/img/howelse/set2_4.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"timeline-panel\">\r\n                                <div class=\"timeline-heading\">\r\n                                    <h4>Our LMS needs a new look</h4>\r\n                                </div>\r\n                                <div class=\"timeline-body\">\r\n                                    <p class=\"text-muted\">First impressions are important. We provide theming and branding to Moodle sites, ensuring themes will run on multiple browsers and tablet devices.</p>\r\n                                </div>\r\n                            </div>\r\n                        </li>\r\n                         <li class=\"timeline-inverted\">\r\n                            <div class=\"timeline-image\">\r\n                                <img class=\"img-circle img-responsive\" src=\"/img/howelse/set2_5.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"timeline-panel\">\r\n                                <div class=\"timeline-heading\">\r\n                                    <h4>I need LMS hosting</h4>\r\n                                </div>\r\n                                <div class=\"timeline-body\">\r\n                                    <p class=\"text-muted\">We work with exceptional LMS hosting providers to provide security and peace of mind.  Regardless of the size of your organisation we can provide a solution that will fit your needs.</p>\r\n                                </div>\r\n                            </div>\r\n                        </li>\r\n                        <li>\r\n                            <div class=\"timeline-image\">\r\n                                <img class=\"img-circle img-responsive\" src=\"/img/howelse/set2_6.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"timeline-panel\">\r\n                                <div class=\"timeline-heading\">\r\n                                    <h4>I need a custom plugin<br>(or need one fixed)</h4>\r\n                                </div>\r\n                                <div class=\"timeline-body\">\r\n                                    <p class=\"text-muted\">Sometimes you just need that bit extra. We can customise or develop Moodle plugins that will suit the exact business requirements of your organisation.</p>\r\n                                </div>\r\n                            </div>\r\n                        </li>\r\n                        <li class=\"timeline-inverted\">\r\n                            <div class=\"timeline-image\">\r\n                                <h4>Something More?\r\n                                    <br>Contact us!</h4>\r\n                            </div>\r\n                        </li>\r\n                    </ul>\r\n</div>','','',''),
