	(3,'Other Services','','section services',0,3,'We have worked in e-learning for more than 15 years and whilst we have used a number of LMS platforms and content tools, we reccomend, develop for and customise Moodle. We work closely with hosting companies for custom implementations, perform consultancy work in the e-learning space, manage sites and upgrades, and develop custom integration solutions for organisations. Take a look at some stories from our clients.\r\n\r\n<div class=\"flex-no-wrap\">\r\n<a href=\"#!\"><img src=\"https://placehold.it/200x113/333/ddd?text=[Play]\"> ANMF Portal Integration Story</a>\r\n<a href=\"#!\"><img src=\"https://placehold.it/200x113/333/ddd?text=[Play]\"> Avant Catalogue Integration Story</a>\r\n<a href=\"#!\"><img src=\"https://placehold.it/200x113/333/ddd?text=[Play]\"> Clinicians API tool launch story</a>\r\n<a href=\"#!\"><img src=\"https://placehold.it/200x113/333/ddd?text=[Play]\"> ITTA Theme customisation story</a>\r\n</div>\r\n\r\nInterested? Fill in the form below to get in touch.','','services','Services',NULL,NULL,NULL,NULL);
